import styled from "styled-components";
import { FONTS } from "../../Constants";

const Header = () => {
  return (
    <Wrapper>
      <Brand>Sole&Anlke</Brand>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  display: flex;
`;

const Brand = styled.span`
  font-family: ${FONTS.raleway}
  font-size: ${24 / 16}rem;
`;

export default Header;
